def crear():
    from apps.usuario.models import User
    for u in datos:
        me = User.objects.create_user(username=u[0], email=u[1])
        me.set_password(u[2])
        me.save()

def actualizar():
    from apps.usuario.models import User
    for u in extra_datos:
        obj = User.objects.get(username=u[0])
        obj.nombres = u[1]
        obj.apellido1 = u[2]
        obj.apellido2 = u[3]
        obj.identificacion = u[4]
        obj.fecha_nacimiento = u[5]
        obj.sexo = u[6]
        obj.fecha_ingreso = u[7]
        obj.cargo = u[8]
        obj.jefe = User.objects.get(username=u[9]) if u[9] else None
        obj.zona = u[10]
        obj.municipio = u[11]
        obj.departamento = u[12]
        obj.foto = u[14] 
        obj.telefono = u[15] 
        obj.save()
        print("*")

def vender():
    from apps.cliente.models import Cliente
    from apps.venta.models import Venta
    from apps.usuario.models import User
    cl = Cliente.objects.all().first()
    for dato in extra_datos:
        vendedor = User.objects.get(username=dato[0])
        venta = Venta()
        venta.vendedor = vendedor
        venta.cliente = cl
        venta.fecha = '2021-09-16'
        venta.valor = dato[13] if dato[13] else 1
        venta.servicio = 'Prueba'
        venta.save()
        print("*")